import UpcomingRaces from './UpcomingRaces';
import Home from './Home';
import './Navbar.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
const Navbar
    = () => {
        return (
            <Router>
                <div className="Navbar">
                    <div className="links">
                        <a href="/">Home</a>
                        <li>
                            <Link to="/upcomingRaces">Upcoming Races</Link>
                        </li>
                        <a href="/races">My Races</a>
                        <a href="/teams">Teams</a>
                        <a href="/cars">Garage</a>
                        <a href="/users">My Profile</a>
                    </div>
                </div>
                <div className="navContain">
                    <Routes>
                        <Route exact path="/" component={Home} />
                        <Route path="/upcomingraces" component={UpcomingRaces} />
                    </Routes>
                </div>
            </Router>

        );
    }

export default Navbar;
